		milestone: null,
		comments: 0,
		created_at: '2023-06-11T17:06:38Z',
		updated_at: '2023-06-11T17:14:02Z',
		closed_at: null,
		author_association: 'NONE',
		active_lock_reason: null,
		body: "### Which @angular/* package(s) are relevant/related to the feature request?\n\n_No response_\n\n### Description\n\nI would like to propose a new feature for Angular that adds folder space verification before running the 'ng new' command. Currently, there is no built-in mechanism to check if there is sufficient space available in the destination folder before generating a new Angular application.\r\n\r\nThis feature would enhance the user experience by providing an upfront check to ensure that the destination folder has enough space to accommodate the newly created application. It would prevent potential issues that may arise due to insufficient disk space during the application generation process.\r\n\r\n\n\n### Proposed solution\n\nThe proposed feature would prompt the user with a warning message if there is not enough space available in the target folder, allowing them to choose an alternative location. \r\n\r\nOn the other hand, if sufficient space is detected, the 'ng new' command would proceed as usual.\r\n\r\nThis feature aims to improve usability and prevent unnecessary errors, ultimately making the process of creating new Angular applications smoother and more reliable.\n\n### Alternatives considered\n\nError Handling: \r\nOne alternative considered was handling the insufficient space issue as an error during the 'ng new' command execution. Instead of checking the space beforehand, the command would proceed and throw an error if there is not enough space. \r\n\r\nHowever, this approach may lead to confusion for users and could potentially interrupt the application generation process abruptly.\r\n\r\nManual Space Check: \r\nAnother alternative was to provide users with a separate command or utility to manually check the available space in the destination folder before running 'ng new'. \r\n\r\nWhile this approach gives more flexibility, it adds an extra step and may not be intuitive for users who expect a seamless space verification integrated within the 'ng new' command.\r\n\r\nSize Estimation: \r\nA different approach considered was estimating the size of the generated application based on the selected options and dependencies. \r\n\r\nThe estimated size could then be compared against the available space in the destination folder. \r\nHowever, accurately estimating the size can be complex due to factors like external dependencies, custom configurations, and dynamic module loading.",
