		body: '### Which @angular/* package(s) are the source of the bug?\n\ncompiler-cli, compiler\n\n### Is this a regression?\n\nNo\n\n### Description\n\nCreated  simple project. Included in angular.json assets that points to package in node-modules directory, to copy assets.\r\n            "assets": [\r\n              "src/favicon.ico",\r\n              "src/assets",\r\n              {\r\n                "glob": "**/*",\r\n                "input": "./node_modules/tinymce",\r\n                "output": "/tinymce/"\r\n              }\r\nRestarted ng serve my-app.\r\nAfter making couple changes, random changes really. Application start recompiling non stop.\r\n \n\n### Please provide a link to a minimal reproduction of the bug\n\nhttps://github.com/DimitriLib/angular-test\n\n### Please provide the exception or error you saw\n\n```true\n√ Compiled successfully.\r\n√ Browser application bundle generation complete.\r\n\r\n5 unchanged chunks\r\n\r\nBuild at: 2023-06-11T05:41:42.190Z - Hash: 2ca09f110fc834bc - Time: 138ms\r\n\r\n√ Compiled successfully.\r\n√ Browser application bundle generation complete.\r\n\r\n5 unchanged chunks\r\n\r\nBuild at: 2023-06-11T05:41:42.375Z - Hash: 2ca09f110fc834bc - Time: 125ms\r\n\r\n√ Compiled successfully.\r\n√ Browser application bundle generation complete.\r\n\r\n5 unchanged chunks\r\n\r\nBuild at: 2023-06-11T05:41:42.564Z - Hash: 2ca09f110fc834bc - Time: 138ms\n```\n\n\n### Please provide the environment you discovered this bug in (run `ng version`)\n\n```true\nAngular CLI: 15.2.8                                        \r\nNode: 18.12.1                                              \r\nPackage Manager: npm 8.19.2                                \r\nOS: win32 x64                                              \r\n                                                           \r\nAngular: 15.2.9                                            \r\n... animations, common, compiler, compiler-cli, core, forms\r\n... platform-browser, platform-browser-dynamic, router     \r\n                                                           \r\nPackage                         Version                    \r\n---------------------------------------------------------  \r\n@angular-devkit/architect       0.1502.8                   \r\n@angular-devkit/build-angular   15.2.8                     \r\n@angular-devkit/core            15.2.8                     \r\n@angular-devkit/schematics      15.2.8                     \r\n@angular/cli                    15.2.8                     \r\n@schematics/angular             15.2.8                     \r\nrxjs                            7.8.1\r\ntypescript                      4.9.5\n```\n\n\n### Anything else?\n\n_No response_',
