		body: '### Command\n\nserve\n\n### Is this a regression?\n\n- [X] Yes, this behavior used to work in the previous version\n\n### The previous version in which this bug was not present was\n\n15.2.8\n\n### Description\n\nI\'m using the [dev server proxy](https://angular.io/guide/build#proxying-to-a-backend-server) to forward HTTP responses from my localhost HTTP backend to my localhost Angular application running in a browser.\r\n\r\nSince I upgraded to Angular CLI v16, one specific response is unable to be proxied back to the browser, failing with an HTTP 500.\r\n\r\nRunning Angular CLI with an altered NodeJS option seems to solve the issue, but that\'s not very handy:\r\n```\r\nnode --max-http-header-size=32768 node_modules/.bin/ng serve\r\n```\n\n### Minimal Reproduction\n\n1. Generate a new Angular app with `ng new`.\r\n2. Configure a `proxyConfig` in `angular.json`, proxying for example from `localhost:4200/api` to `localhost:8080/api`\r\n3. Configure the backend server to respond with more than 8 kio of HTTP headers.\r\n4. Run `ng serve`\r\n5. Run any request that triggers the proxy redirection.\r\n6. The proxy responds with an HTTP 500 and an "HPE_HEADER_OVERFLOW" error is printed into the terminal.\n\n### Exception or Error\n\n```text\n[webpack-dev-server] [HPM] Error occurred while proxying request localhost:4200/api/web/diffusion-requests/search?ascending=true&orderBy=scheduledDate&pageNumber=1&pageSize=10 to http://localhost:9002/ [HPE_HEADER_OVERFLOW] (https://nodejs.org/api/errors.html#errors_common_system_errors)\n```\n\n\n### Your Environment\n\n```text\nAngular CLI: 16.0.5\r\nNode: 18.16.0\r\nPackage Manager: npm 9.5.1\r\nOS: linux x64\r\n\r\nAngular: 16.0.4\r\n... animations, common, compiler, compiler-cli, core, forms\r\n... localize, platform-browser, platform-browser-dynamic, router\r\n\r\nPackage                         Version\r\n---------------------------------------------------------\r\n@angular-devkit/architect       0.1600.5\r\n@angular-devkit/build-angular   16.0.5\r\n@angular-devkit/core            16.0.5\r\n@angular-devkit/schematics      16.0.5\r\n@angular/cdk                    16.0.3\r\n@angular/cli                    16.0.5\r\n@schematics/angular             16.0.5\r\nrxjs                            7.8.1\r\ntypescript                      4.9.5\n```\n\n\n### Anything else relevant?\n\n_No response_',
