		body: "### Which @angular/* package(s) are relevant/related to the feature request?\r\n\r\ncompiler-cli, compiler\r\n\r\n### Description\r\n\r\nI am trying to write a CI pipeline to check our Angular app for type errors. I have come across Issue angular/angular#49194, which suggests to use `ngc --noEmit`. This solution seems to work fine, except we are using scss for our styles and this results in errors such as:\r\n```output\r\nCouldn't resolve resource vars_mixins from /path/to/component/some.component.scss\r\n```\r\nThese errors seem to be caused by shorthand imports such as\r\n```scss\r\n@import 'vars_mixins';\r\n```\r\nand can be fixed by using absolute file paths and file extensions. However, this is not an option for style files imported from `node_modules` which will usually include shorthand imports such as the one shown above (e.g. bootstrap).\r\n\r\nIs there any way to work around this issue? It seems that preprocessor options are only defined in `angular.json`, which means I would have to run the preprocessor step manually before running `ngc` to get this working?\r\n\r\n### Proposed solution\r\n\r\nIdeally there should be a way to run a simple type check with the angular CLI similar to what tools like [svelte-check](https://www.npmjs.com/package/svelte-check) achieve.\r\n\r\n### Alternatives considered\r\n\r\nN/A",
